from youwol.app.environment import YouwolEnvironment
from youwol.app.environment.models import IPipelineFactory
from youwol.app.environment.models_project import BrowserApp, Execution, Link, BrowserAppGraphics, OpenWith
from youwol.pipelines.pipeline_typescript_weback_npm import pipeline, PipelineConfig
from youwol.utils.context import Context


class PipelineFactory(IPipelineFactory):

    def __init__(self, **kwargs):
        super().__init__(**kwargs)

    async def get(self, env: YouwolEnvironment, context: Context):
        config = PipelineConfig(target=BrowserApp(
            displayName="CDN",
            execution=Execution(
                standalone=True,
                parametrized=[
                    OpenWith(
                        match={"kind": "package"},
                        parameters={"package-name": 'name'}
                    )
                ]
            ),
            links=[
                Link(name="doc", url="dist/docs/modules.html"),
                Link(name="coverage", url="coverage/lcov-report/index.html"),
                Link(name="bundle-analysis", url="dist/bundle-analysis.html")
            ],
            graphics=BrowserAppGraphics(
                appIcon={"class": "appIcon",
                         "style": {
                             "width": "80px",
                             "height": "80px",
                             "background-image": bgImage,
                             "background-size": "contain",
                             "background-repeat": "no-repeat",
                             "background-position": "center center",
                             "filter": "drop-shadow(rgb(0, 0, 0) 1px 3px 5px)",
                             "border-radius": "20px"
                         }},
                fileIcon={
                    "class": "fileIcon",
                    "style": {
                        "width": "30px",
                        "height": "30px",
                        "background-image": bgImage,
                        "background-size": "contain",
                        "background-repeat": "no-repeat",
                        "background-position": "center center",
                        "filter": "drop-shadow(rgb(0, 0, 0) 1px 3px 5px)",
                        "border-radius": "20px"
                    }
                },
                background={
                    "class": "backgroundIcon",
                    "style": {
                        "width": '100%',
                        "height": '100%',
                        "opacity": 0.3,
                        "background-color": "#FFFFFF",
                        "background-attachment": "fixed",
                        "background-size": "cover",
                        "background-image": bgImage
                    }
                }
            ),
        ))
        return await pipeline(config, context)


bgImage = "url('data:image/png;base64,')"
